Undesirable structure when populating sub document with Mongoose<p>A user has project IDs but I also want to store some additional project info:</p>

<pre><code>const userSchema = new Schema({
...
  projects: [{
    _id: {
      type: Schema.Types.ObjectId,
      ref: 'Project',
      unique: true, // needed?
    },
    selectedLanguage: String,
  }]
});
</code></pre>

<p>And I want to populate with the project name so I'm doing:</p>

<pre><code>const user = await User
  .findById(req.user.id, 'projects')
  .populate('projects._id', 'name')
  .exec();
</code></pre>

<p>However <code>user.projects</code> gives me this undesirable output:</p>

<pre><code>[
  {
    selectedLanguage: 'en',
    _id: { name: 'ProjectName', _id: 5a50ccde03c2d1f5a07e0ff3 }
  }
]
</code></pre>

<p>What I wanted was:</p>

<pre><code>[
  { name: 'ProjectName', _id: 5a50ccde03c2d1f5a07e0ff3, selectedLanguage: 'en' }
]
</code></pre>

<p>I can transform the data but I'm hoping that Mongoose can achieve this out the box as it seems a common scenario? Thanks.</p>

