MongoDB aggregate query to get the Unique element list and count of every instance in record<p>I have a 2 collections as shown below.</p>

<p>data1:</p>

<pre><code>{ "_id" : , "timestamp" : ISODate("2016-01-05T07:42:37.312Z"), "Prof_Name" : "Jack ", "SUBJECT" : "Maths, Chemistry, Machinery1, Ele1" }
{ "_id" : , "timestamp" : ISODate("2016-01-05T07:42:37.312Z"), "Prof_Name" : "Mac", "SUBJECT" : "Chemistry, CS, German" }
</code></pre>

<p>data2:</p>

<pre><code>{ "_id" : ObjectId(""), timestamp" : ISODate("2016-08-05T07:42:37.312Z", "SUBJECT_ID" : "Maths", "ID" : "OI-12", "Rating" : 6, "UUID" : 8123 }
{ "_id" : ObjectId(""), timestamp" : ISODate("2017-09-05T07:42:37.312Z", "SUBJECT_ID" : "Maths, Machinery1, German", "ID" : "OI-134", "Rating" : 6, "UUID" : 8123 }
{ "_id" : ObjectId(""), timestamp" : ISODate("2016-01-05T07:42:37.312Z", "SUBJECT_ID" : "Machinery1, Maths, French, German", "ID" : "OI-32", "Rating" : 3, "UUID" : 8123 }
{ "_id" : ObjectId(""), timestamp" : ISODate("2016-01-05T07:42:37.312Z", "SUBJECT_ID" : "CS, Chemistry", "ID" : "OI-36", "Rating" : , "UUID" : 8124 }
</code></pre>

<p>I want to get a  3 collection,between timestamp Jan 2016 to Nov 2106 where for each Prof_Name and subject  in SUBJECT from "data1", check if its present in "data2" and get the UUID and UUID count as 1,  if the same subject is found in next record make the UUID count =2 and so on. Herre is how my collection would like ..</p>

<p>data3:</p>

<pre><code>{ "_id" : ,
"Prof_Name" : "Jack", 
"Subjects_list" : [ "Maths", "Chemistry", "Machinery1"], 
"UUID_list" : [8123, 8124 ], 
"UUID_count" : 3,   // Because UUID 8123 has present in 2 records which comes under 2016 timestamp
"subject_count" : 3 } // Ele1 is not mentioned because it has not been seen in any of the data2 record
{ "_id" : , 
"Prof_Name" : "Mac", 
"Subjects_list" : [ "CS"], 
"UUID_list" : [8124 ],  
"UUID_count" : 1,   // Because UUID 8123 has present in 2 records which comes under 2016 timestamp
"subject_count" : 1 }
</code></pre>

<p>The aggregated query i have is :</p>

<pre><code>db.data1.aggregate([
  {
    "$addFields": {
      "SUBJECT": {
        "$split": [
          "$SUBJECT",
          ", "
        ]
      }
    }
  },
  {
    "$unwind": "$SUBJECT"
  },
  {
    "$lookup": {
      "from": "data2",
      "let": {
        "subject": "$SUBJECT"
      },
      "pipeline": [
        {
          "$addFields": {
            "SUBJECT_ID": {
              "$split": [
                "$SUBJECT_ID",
                ", "
              ]
            }
          }
        },
        {
          "$match": {
            "$expr": {
              "$in": [
                "$$subject",
                "$SUBJECT_ID"
              ]
            }
          }
        },
        {
          "$project": {
            "UUID": 1,
            "_id": 0
          }
        }
      ],
      "as": "ref_data"
    }
  },
  {
    "$unwind": {
      "path": "$ref_data",
      "preserveNullAndEmptyArrays": true
    }
  },
  {
    "$group": {
      "_id": "$Prof_Name",
      "subjects_list": {
        "$addToSet": "$SUBJECT"
      },
      "UUID_list": {
        "$addToSet": "$ref_data.UUID"
      }
    }
  },
  {
    "$addFields": {
      "Prof_Name": "$_id",
      "UUID_count": {
        "$size": "$UUID_list"
      },
      "subject_count": {
        "$size": "$subjects_list"
      }
    }
  },
  {
    "$project": {
      "_id": 0
    }
  },
  {
    "$out": "data3"
  }
])
</code></pre>

<p>What modifications does this query require to get the above mentioned collection data3, mainy UUID_list and UUID-count and Subject_list.</p>

<p>Also want to know how to match timestamp of records given a month and year but not iso in the below query aggregate query.</p>

<p>Tried this :</p>

<pre><code>    { "$project": {"year":{"$year":"$timestamp"},"month":{"$month":"$timestamp"}}},{ "$match":{"year" :"2016","month": "01"}}  
</code></pre>

<p>but dint work.</p>

